   /* menu selection correct or not */
export default function clicker1(mar, setOne, setCorrectChar1, setCharMenu) {
  if (mar[0] === "mar") {
    setOne(["one"]);
    setCorrectChar1(true);
    setCharMenu(false);
  } else {
    setCharMenu(false);
  }
}
